package com.xpwi.service.impl;import com.xpwi.dao.impl.SearchForAllDAOImpl;import com.xpwi.service.ISearchForAllService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;import java.util.Map;@Servicepublic class SearchForAllServiceImpl implements ISearchForAllService {    @Autowired    SearchForAllDAOImpl searchForAllDAOImpl;    @Override    public List<Map<String, String>> searchForAll(String str) {        List<Map<String, String>> maps = searchForAllDAOImpl.searchForAll(str);        return maps;    }}